import { fetchVideoById } from '../api';
import Navbar from '../components/Navbar';
import {useState, useEffect} from 'react';

function Video() {
    const [videos, setVideos] = useState([]);

    async function fetchData() {
        const data = await fetchVideoById();
        setVideos(data);
    }

    useEffect(() => {
        fetchData();
    }, []);
    return (
        <div className="min-h-screen w-screen overflow-x-hidden bg-primary text-text-primary">
            <Navbar />
            <div className="m-36">
                <video controls>
                    <source
                        src="https://cdn.michaelzhao.xyz/hackutd-devday-workshop/videos/one-piece.mp4"
                        type="video/mp4"
                    ></source>
                </video>
                <h1 className="text-3xl font-bold">One Piece</h1>
            </div>
        </div>
    );
}

export default Video;
